this["App"]["Templates"]["reusables/abcom-donut"] = Handlebars.template({"compiler":[7,">= 4.0.0"],"main":function(container,depth0,helpers,partials,data) {
    return "<h2>Donut Chart</h2>\r\n<p>Displays a graphical representation of a certain number or count. This component is useful for displaying surveys, or any type of record counting.</p>\r\n<div class=\"panel panel-default\">\r\n	<div class=\"panel-body\">\r\n		<!-- insert section title component here -->\r\n		<div id=\"donut_id\" class=\"abcom abcom-donut\">\r\n			<div class=\"donut\">\r\n				<h1>35</h1>\r\n				<div>Requests Approved</div>\r\n			    <svg width=\"150\" height=\"150\" xmlns=\"http://www.w3.org/2000/svg\">\r\n			     <g>\r\n			      <title>Layer 1</title>\r\n			      <circle id=\"circle\" class=\"filler\" r=\"69.85699\" cy=\"75\" cx=\"75\" fill=\"none\"/>\r\n			      <circle id=\"circle\" class=\"circle_animation\" r=\"69.85699\" cy=\"75\" cx=\"75\" fill=\"none\"/>\r\n			     </g>\r\n			    </svg>\r\n			</div>\r\n		</div>\r\n		<p>Here is the sample code:</p>\r\n<pre class=\"yondu__code\"><code>&lt;div id=&quot;donut_id&quot; class=&quot;abcom abcom-donut&quot;&gt;\r\n    &lt;div class=&quot;donut&quot;&gt;\r\n        &lt;h1&gt;35&lt;/h1&gt;\r\n        &lt;div&gt;Requests Approved&lt;/div&gt;\r\n        &lt;svg width=&quot;150&quot; height=&quot;150&quot; xmlns=&quot;http://www.w3.org/2000/svg&quot;&gt;\r\n         &lt;g&gt;\r\n          &lt;title&gt;Layer 1&lt;/title&gt;\r\n          &lt;circle id=&quot;circle&quot; class=&quot;filler&quot; r=&quot;69.85699&quot; cy=&quot;75&quot; cx=&quot;75&quot; fill=&quot;none&quot;/&gt;\r\n          &lt;circle id=&quot;circle&quot; class=&quot;circle_animation&quot; r=&quot;69.85699&quot; cy=&quot;75&quot; cx=&quot;75&quot; fill=&quot;none&quot;/&gt;\r\n         &lt;/g&gt;\r\n        &lt;/svg&gt;\r\n    &lt;/div&gt;\r\n&lt;/div&gt;</code></pre>\r\n	<p>Instantiate the Donut Chart using javascript:</p>\r\n<pre class=\"yondu__code\"><code>var donut = $('#donut_id');\r\ninitDonut(donut);</code></pre>\r\n<p>Here, we declared a variable that contains the element to manipulate, and use the <code>initDonut</code> function to animate the chart.</p>\r\n	</div>\r\n</div>";
},"useData":true});

this["App"]["Templates"]["reusables/abcom-filter"] = Handlebars.template({"compiler":[7,">= 4.0.0"],"main":function(container,depth0,helpers,partials,data) {
    return "<h2>Search Filter Bar</h2>\r\n<p>Displays the filter section for a recordset. The section also occupies the width of its parent container.</p>\r\n<div class=\"panel panel-default\">\r\n	<div class=\"panel-body\">\r\n		<!-- insert section title component here -->\r\n		<div class=\"abcom abcom-filter nav\">\r\n			<div class=\"navbar-left\">\r\n				<div class=\"form-group\">\r\n					<label for=\"\" class=\"abcom-filter__label\">Filter/Search by:</label>\r\n		        	<select name=\"\" id=\"\" class=\"selectpicker abcom-form abcom-form--min form-control abcom-filter__category\">\r\n		        		<option selected>Select Category</option>\r\n		        		<option value=\"text\">Creator</option>\r\n		        		<option value=\"dropdown\">Status</option>\r\n		        		<option value=\"date\">Date</option>\r\n		        		<option value=\"daterange\">Date Range</option>\r\n		        	</select>\r\n		        	<input type=\"text\" class=\"form-control abcom-form abcom-form--min abcom-filter__type\" data-filter-type=\"text\" placeholder=\"Search here\">\r\n		        	<select name=\"\" id=\"\" class=\"selectpicker abcom-form abcom-form--min form-control abcom-filter__type\" data-filter-type=\"dropdown\">\r\n		        		<option value=\"\">Option 1</option>\r\n		        		<option value=\"\">Option 2</option>\r\n		        		<option value=\"\">Option 3</option>\r\n		        		<option value=\"\">Option 4</option>\r\n		        		<option value=\"\">Option 5</option>\r\n		        	</select>\r\n\r\n		        	<div class=\"abcom-filter__type abcom-filter__type--date\" data-filter-type=\"daterange\">\r\n		                <div class='input-group abcom-filter__date' data-role=\"from\">\r\n		                    <input type='text' class=\"form-control abcom-form abcom-form--min\" placeholder=\"From\" />\r\n		                    <span class=\"input-group-addon\">\r\n		                        <span class=\"glyphicon glyphicon-calendar\"></span>\r\n		                    </span>\r\n		                </div>\r\n		                <div class='input-group abcom-filter__date' data-role=\"to\">\r\n		                    <input type='text' class=\"form-control abcom-form abcom-form--min\" placeholder=\"To\" />\r\n		                    <span class=\"input-group-addon\">\r\n		                        <span class=\"glyphicon glyphicon-calendar\"></span>\r\n		                    </span>\r\n		                </div>\r\n		            </div>\r\n\r\n		            <div class=\"abcom-filter__type abcom-filter__type--date\" data-filter-type=\"date\">\r\n		                <div class='input-group abcom-filter__date'>\r\n		                    <input type='text' class=\"form-control abcom-form abcom-form--min\" placeholder=\"Select Date\" />\r\n		                    <span class=\"input-group-addon\">\r\n		                        <span class=\"glyphicon glyphicon-calendar\"></span>\r\n		                    </span>\r\n		                </div>\r\n		            </div>\r\n\r\n	            	<button type=\"button\" class=\"btn abcom-btn abcom-btn--default abcom-filter__btn abcom-filter__btn--search\">Search</button>\r\n	            	<button type=\"button\" class=\"btn abcom-btn abcom-btn--default abcom-filter__btn abcom-filter__btn--clear\">Clear</button>\r\n		    	</div>\r\n			</div>\r\n			<div class=\"navbar-right\">\r\n				<div class=\"form-group\">\r\n					<button type=\"button\" class=\"btn abcom-btn abcom-btn--default abcom-btn--rounded abcom-filter__btn--legend\">View Legends</button>\r\n					<label for=\"\" class=\"abcom-filter__label\">Entries per page</label>\r\n		        	<select name=\"\" id=\"\" class=\"selectpicker abcom-form abcom-form--min form-control abcom-filter__entries abcom-filter__last\">\r\n		        		<option value=\"10\">10</option>\r\n		        		<option value=\"25\">25</option>\r\n		        		<option value=\"50\">50</option>\r\n		        		<option value=\"100\">100</option>\r\n		        	</select>\r\n		    	</div>\r\n			</div>\r\n		</div>\r\n		<p>Here is the code sample for the Search Filter Section:</p>\r\n<pre class=\"yondu__code\"><code>&lt;div class=&quot;abcom abcom-filter nav&quot;&gt;\r\n  &lt;div class=&quot;navbar-left&quot;&gt;\r\n    &lt;div class=&quot;form-group&quot;&gt;\r\n      &lt;label for=&quot;&quot; class=&quot;abcom-filter__label&quot;&gt;Filter/Search by:&lt;/label&gt;\r\n          &lt;select name=&quot;&quot; id=&quot;&quot; class=&quot;selectpicker abcom-form abcom-form--min form-control abcom-filter__category&quot;&gt;\r\n            &lt;option selected&gt;Select Category&lt;/option&gt;\r\n            &lt;option value=&quot;text&quot;&gt;Creator&lt;/option&gt;\r\n            &lt;option value=&quot;dropdown&quot;&gt;Status&lt;/option&gt;\r\n            &lt;option value=&quot;date&quot;&gt;Date&lt;/option&gt;\r\n            &lt;option value=&quot;daterange&quot;&gt;Date Range&lt;/option&gt;\r\n          &lt;/select&gt;\r\n          &lt;input type=&quot;text&quot; class=&quot;form-control abcom-form abcom-form--min abcom-filter__type&quot; data-filter-type=&quot;text&quot; placeholder=&quot;Search here&quot;&gt;\r\n          &lt;select name=&quot;&quot; id=&quot;&quot; class=&quot;selectpicker abcom-form abcom-form--min form-control abcom-filter__type&quot; data-filter-type=&quot;dropdown&quot;&gt;\r\n            &lt;option value=&quot;&quot;&gt;Option 1&lt;/option&gt;\r\n            &lt;option value=&quot;&quot;&gt;Option 2&lt;/option&gt;\r\n            &lt;option value=&quot;&quot;&gt;Option 3&lt;/option&gt;\r\n            &lt;option value=&quot;&quot;&gt;Option 4&lt;/option&gt;\r\n            &lt;option value=&quot;&quot;&gt;Option 5&lt;/option&gt;\r\n          &lt;/select&gt;\r\n\r\n          &lt;div class=&quot;abcom-filter__type abcom-filter__type--date&quot; data-filter-type=&quot;daterange&quot;&gt;\r\n                &lt;div class='input-group abcom-filter__date' data-role=&quot;from&quot;&gt;\r\n                    &lt;input type='text' class=&quot;form-control abcom-form abcom-form--min&quot; placeholder=&quot;From&quot; /&gt;\r\n                    &lt;span class=&quot;input-group-addon&quot;&gt;\r\n                        &lt;span class=&quot;glyphicon glyphicon-calendar&quot;&gt;&lt;/span&gt;\r\n                    &lt;/span&gt;\r\n                &lt;/div&gt;\r\n                &lt;div class='input-group abcom-filter__date' data-role=&quot;to&quot;&gt;\r\n                    &lt;input type='text' class=&quot;form-control abcom-form abcom-form--min&quot; placeholder=&quot;To&quot; /&gt;\r\n                    &lt;span class=&quot;input-group-addon&quot;&gt;\r\n                        &lt;span class=&quot;glyphicon glyphicon-calendar&quot;&gt;&lt;/span&gt;\r\n                    &lt;/span&gt;\r\n                &lt;/div&gt;\r\n            &lt;/div&gt;\r\n\r\n            &lt;div class=&quot;abcom-filter__type abcom-filter__type--date&quot; data-filter-type=&quot;date&quot;&gt;\r\n                &lt;div class='input-group abcom-filter__date'&gt;\r\n                    &lt;input type='text' class=&quot;form-control abcom-form abcom-form--min&quot; placeholder=&quot;Select Date&quot; /&gt;\r\n                    &lt;span class=&quot;input-group-addon&quot;&gt;\r\n                        &lt;span class=&quot;glyphicon glyphicon-calendar&quot;&gt;&lt;/span&gt;\r\n                    &lt;/span&gt;\r\n                &lt;/div&gt;\r\n            &lt;/div&gt;\r\n\r\n            &lt;button type=&quot;button&quot; class=&quot;btn abcom-btn abcom-btn--default abcom-filter__btn abcom-filter__btn--search&quot;&gt;Search&lt;/button&gt;\r\n            &lt;button type=&quot;button&quot; class=&quot;btn abcom-btn abcom-btn--default abcom-filter__btn abcom-filter__btn--clear&quot;&gt;Clear&lt;/button&gt;\r\n      &lt;/div&gt;\r\n  &lt;/div&gt;\r\n  &lt;div class=&quot;navbar-right&quot;&gt;\r\n    &lt;div class=&quot;form-group&quot;&gt;\r\n      &lt;button type=&quot;button&quot; class=&quot;btn abcom-btn abcom-btn--default abcom-btn--rounded abcom-filter__btn--legend&quot;&gt;View Legends&lt;/button&gt;\r\n      &lt;label for=&quot;&quot; class=&quot;abcom-filter__label&quot;&gt;Entries per page&lt;/label&gt;\r\n          &lt;select name=&quot;&quot; id=&quot;&quot; class=&quot;selectpicker abcom-form abcom-form--min form-control abcom-filter__entries abcom-filter__last&quot;&gt;\r\n            &lt;option value=&quot;10&quot;&gt;10&lt;/option&gt;\r\n            &lt;option value=&quot;25&quot;&gt;25&lt;/option&gt;\r\n            &lt;option value=&quot;50&quot;&gt;50&lt;/option&gt;\r\n            &lt;option value=&quot;100&quot;&gt;100&lt;/option&gt;\r\n          &lt;/select&gt;\r\n      &lt;/div&gt;\r\n  &lt;/div&gt;\r\n&lt;/div&gt;</code></pre>\r\n	</div>\r\n</div>\r\n\r\n<p>Integrating with <code>Data Table</code> plugin. Just add a <code>data-target</code> attribute in the <code>select</code> element, pointing the id of the data table. Example:</p>\r\n<pre class=\"yondu__code\"><code>&lt;select name=&quot;&quot; id=&quot;&quot; class=&quot;selectpicker abcom-form abcom-form--min form-control abcom-filter__entries abcom-filter__last&quot; <b>data-target=&quot;#table_id&quot;</b>&gt;</code></pre>\r\n<pre class=\"yondu__code\"><code>&lt;table <b>id=&quot;table_id&quot;</b> class=&quot;abcom abcom-table&quot;&gt;</code></pre>";
},"useData":true});

this["App"]["Templates"]["reusables/abcom-forms"] = Handlebars.template({"compiler":[7,">= 4.0.0"],"main":function(container,depth0,helpers,partials,data) {
    return "<h2>Forms</h2>\r\n<p>Forms play a huge part especially inside a CMS website / app. Aboitiz Legal has this set of form elements for you to use.</p>\r\n\r\n<h3>Labels</h3>\r\n<p>Labels will be in fixed <code>40px</code> height.</p>\r\n<div class=\"panel panel-default\">\r\n	<div class=\"panel-body\">\r\n		<label for=\"\" class=\"abcom-form\">This is a Label</label>\r\n	</div>\r\n</div>\r\n<pre class=\"yondu__code\"><code>&lt;label for=&quot;&quot; class=&quot;abcom-form&quot;&gt;This is a Label&lt;/label&gt;</code></pre>\r\n<h3>Input box</h3>\r\n<p>This utilizes bootstrap feature for styling inputs.</p>\r\n<div class=\"panel panel-default\">\r\n	<div class=\"panel-body\">\r\n		<p>This sample is the default size:</p>\r\n		<input type=\"text\" class=\"form-control abcom-form abcom-form--min abcom-form--hasmargin\" placeholder=\"This is an Input\">\r\n<pre class=\"yondu__code\"><code>&lt;input type=&quot;text&quot; class=&quot;form-control abcom-form abcom-form--min abcom-form--hasmargin&quot; placeholder=&quot;This is an Input&quot;&gt;</code></pre>\r\n		<p>This sample will occupy the width of its parent element:</p>\r\n		<input type=\"text\" class=\"form-control abcom-form abcom-form--full abcom-form--hasmargin\" placeholder=\"This is an Input\">\r\n<pre class=\"yondu__code\"><code>&lt;input type=&quot;text&quot; class=&quot;form-control abcom-form abcom-form--full abcom-form--hasmargin&quot; placeholder=&quot;This is an Input&quot;&gt;</code></pre>\r\n	</div>\r\n</div>\r\n\r\n<h3>Textarea</h3>\r\n<div class=\"panel panel-default\">\r\n	<div class=\"panel-body\">\r\n		<p>Here is a sample of a Textarea:</p>\r\n		<textarea class=\"form-control abcom-form abcom-form--full abcom-form--hasmargin\" placeholder=\"This is a Textarea\"></textarea>\r\n<pre class=\"yondu__code\"><code>&lt;textarea class=&quot;form-control abcom-form abcom-form--full abcom-form--hasmargin&quot; placeholder=&quot;This is a Textarea&quot;&gt;&lt;/textarea&gt;</code></pre>\r\n	</div>\r\n</div>\r\n\r\n<h3>Select Dropdown</h3>\r\n<div class=\"panel panel-default\">\r\n	<div class=\"panel-body\">\r\n		<p>Dropdown utilizes a bootstrap plugin called bootstrap select</p>\r\n		<select name=\"\" id=\"\" class=\"selectpicker abcom-form abcom-form--min abcom-form--hasmargin form-control\">\r\n    		<option selected>Select Category</option>\r\n    		<option value=\"\">Creator</option>\r\n    		<option value=\"\">Date</option>\r\n    		<option value=\"\">Status Name</option>\r\n    	</select>\r\n<pre class=\"yondu__code\"><code>&lt;select name=&quot;&quot; id=&quot;&quot; class=&quot;selectpicker abcom-form abcom-form--min abcom-form--hasmargin form-control&quot;&gt;\r\n    &lt;option selected&gt;Select Category&lt;/option&gt;\r\n    &lt;option value=&quot;&quot;&gt;Creator&lt;/option&gt;\r\n    &lt;option value=&quot;&quot;&gt;Date&lt;/option&gt;\r\n    &lt;option value=&quot;&quot;&gt;Status Name&lt;/option&gt;\r\n&lt;/select&gt;</code></pre>\r\n		<p>Or again, you can use a full width select dropdown</p>\r\n		<select name=\"\" id=\"\" class=\"selectpicker abcom-form abcom-form--full abcom-form--hasmargin form-control\">\r\n    		<option selected>Select Category</option>\r\n    		<option value=\"\">Creator</option>\r\n    		<option value=\"\">Date</option>\r\n    		<option value=\"\">Status Name</option>\r\n    	</select>\r\n<pre class=\"yondu__code\"><code>&lt;select name=&quot;&quot; id=&quot;&quot; class=&quot;selectpicker abcom-form abcom-form--full abcom-form--hasmargin form-control&quot;&gt;\r\n    &lt;option selected&gt;Select Category&lt;/option&gt;\r\n    &lt;option value=&quot;&quot;&gt;Creator&lt;/option&gt;\r\n    &lt;option value=&quot;&quot;&gt;Date&lt;/option&gt;\r\n    &lt;option value=&quot;&quot;&gt;Status Name&lt;/option&gt;\r\n&lt;/select&gt;</code></pre>\r\n	</div>\r\n</div>\r\n\r\n<h3>Dates</h3>\r\n<p>Form dates utilizes the datetimepicker from bootstrap.</p>\r\n<div class=\"panel panel-default\">\r\n	<div class=\"panel-body\">\r\n\r\n        <input type='text' class=\"form-control abcom-form abcom-form__date abcom-form--full\" placeholder=\"MM/DD/YYYY\" />                \r\n\r\n	</div>\r\n</div>\r\n<p>Here is the code for the date input.</p>\r\n<pre class=\"yondu__code\"><code>&lt;input type=&quot;text&quot; class=&quot;form-control abcom-form abcom-form__date abcom-form--full&quot; placeholder=&quot;MM/DD/YYYY&quot; /&gt;</code></pre>\r\n\r\n<h3>Using Date Range</h3>\r\n<p>There will be some instances where you must use date range.</p>\r\n\r\n<div class=\"panel panel-default\">\r\n	<div class=\"panel-body\">     \r\n\r\n        <div class=\"abcom-form__daterange\">\r\n            <div class='input-group abcom-form__daterange--from'>\r\n                <input type='text' class=\"form-control abcom-form abcom-form--min\" placeholder=\"From\" />\r\n                <span class=\"input-group-addon\">\r\n                    <span class=\"glyphicon glyphicon-calendar\"></span>\r\n                </span>\r\n            </div>\r\n            <div class='input-group abcom-form__daterange--to'>\r\n                <input type='text' class=\"form-control abcom-form abcom-form--min\" placeholder=\"To\" />\r\n                <span class=\"input-group-addon\">\r\n                    <span class=\"glyphicon glyphicon-calendar\"></span>\r\n                </span>\r\n            </div>\r\n        </div>        \r\n\r\n	</div>\r\n</div>\r\n\r\n<p>Note: To make the daterange work, you need to have the following code:</p>\r\n<p>This uses the <code>abcom-form__daterange</code> class and refer to its <code>abcom-form__daterange--from</code> and <code>abcom-form__daterange--to</code>.</p>\r\n\r\n<pre class=\"yondu__code\"><code>&lt;div class=&quot;abcom-form__daterange&quot;&gt;\r\n    &lt;div class='input-group abcom-form__daterange--from'&gt;\r\n        &lt;input type='text' class=&quot;form-control abcom-form abcom-form--min&quot; placeholder=&quot;From&quot; /&gt;\r\n        &lt;span class=&quot;input-group-addon&quot;&gt;\r\n            &lt;span class=&quot;glyphicon glyphicon-calendar&quot;&gt;&lt;/span&gt;\r\n        &lt;/span&gt;\r\n    &lt;/div&gt;\r\n    &lt;div class='input-group abcom-form__daterange--to'&gt;\r\n        &lt;input type='text' class=&quot;form-control abcom-form abcom-form--min&quot; placeholder=&quot;To&quot; /&gt;\r\n        &lt;span class=&quot;input-group-addon&quot;&gt;\r\n            &lt;span class=&quot;glyphicon glyphicon-calendar&quot;&gt;&lt;/span&gt;\r\n        &lt;/span&gt;\r\n    &lt;/div&gt;\r\n&lt;/div&gt; </code></pre>\r\n\r\n\r\n<hr>\r\n<h3>File upload</h3>\r\n<p>Form file upload</p>\r\n<div class=\"panel panel-default\">\r\n	<div class=\"panel-body\">\r\n		\r\n		<button class=\"btn abcom-btn abcom-btn--default abcom-form--full abcom-upload__addbtn\">\r\n			<i class=\"fa fa-plus\"></i>\r\n			<span>Select Photo</span>\r\n			<input class=\"abcom-upload__file\" type=\"file\" name=\"file\">\r\n		</button>\r\n\r\n	</div>\r\n</div>\r\n<p>Use the upload component's add file button using this code</p>\r\n<pre class=\"yondu__code\"><code>&lt;button class=&quot;btn abcom-btn abcom-btn--default abcom-form--full abcom-upload__addbtn&quot;&gt;\r\n  &lt;i class=&quot;fa fa-plus&quot;&gt;&lt;/i&gt;\r\n  &lt;span&gt;Select Photo&lt;/span&gt;\r\n  &lt;input class=&quot;abcom-upload__file&quot; type=&quot;file&quot; name=&quot;file&quot;&gt;\r\n&lt;/button&gt;</code></pre>\r\n\r\n<h3>Form Buttons</h3>\r\n<p>Form buttons utilize the default buttons.</p>\r\n<div class=\"panel panel-default\">\r\n	<div class=\"panel-body\">\r\n		\r\n		<p>Here is the action type button. It is useful for accent type or main function buttons like submit.</p>\r\n		<input type=\"submit\" class=\"btn abcom-btn abcom-btn--action abcom-form--hasmargin\" value=\"Submit\">\r\n<pre class=\"yondu__code\"><code>&lt;input type=&quot;submit&quot; class=&quot;btn abcom-btn abcom-btn--action abcom-form--hasmargin&quot; value=&quot;Submit&quot;&gt;</code></pre>\r\n		\r\n		<p>Here is the default type button.</p>\r\n		<input type=\"button\" class=\"btn abcom-btn abcom-btn--default abcom-form--hasmargin\" value=\"Preview\">\r\n<pre class=\"yondu__code\"><code>&lt;input type=&quot;submit&quot; class=&quot;btn abcom-btn abcom-btn--default abcom-form--hasmargin&quot; value=&quot;Preview&quot;&gt;</code></pre>\r\n		<button type=\"submit\" class=\"btn abcom-btn abcom-btn--default abcom-form--hasmargin\">Save</button>\r\n<pre class=\"yondu__code\"><code>&lt;button type=&quot;submit&quot; class=&quot;btn abcom-btn abcom-btn--default abcom-form--hasmargin&quot;&gt;Save&lt;/button&gt;</code></pre>\r\n\r\n		<p>You can also add icons same with how we use our buttons component.</p>\r\n		<button class=\"btn abcom-btn abcom-btn--default abcom-form--hasmargin\"><i class=\"fa fa-ban\"></i>Remove</button>\r\n<pre class=\"yondu__code\"><code>&lt;button class=&quot;btn abcom-btn abcom-btn--default abcom-form--hasmargin&quot;&gt;&lt;i class=&quot;fa fa-ban&quot;&gt;&lt;/i&gt;Remove&lt;/button&gt;</code></pre>\r\n		<p>Note: You cannot use <code>&lt;input type=&quot;submit&quot;&gt;</code> for buttons with icon. So, we should use <code>&lt;button&gt;</code> tag instead. and bind its click function to our submit using jquery like:\r\n<pre class=\"yondu__code\"><code>$('#submit_btn').click(function(){\r\n  $('#form_id').submit();\r\n});</code></pre>\r\n	</div>\r\n</div>";
},"useData":true});

this["App"]["Templates"]["reusables/abcom-listing"] = Handlebars.template({"compiler":[7,">= 4.0.0"],"main":function(container,depth0,helpers,partials,data) {
    return "<h2>Listing</h2>\r\n<p>Appears on some forms. Lists Endorsers or Approvers</p>\r\n<div class=\"panel panel-default\">\r\n	<div class=\"panel-body\">\r\n		<div class=\"form-group abcom-list\">\r\n			<label for=\"\" class=\"col-sm-2 abcom-form\">Endorsers</label>\r\n			<div class=\"col-sm-10\">\r\n				<ol class=\"abcom-list__items\">\r\n					<li class=\"abcom-list__item\">Juan Dela Cruz</li>\r\n					<li class=\"abcom-list__item\">Johann Cheese</li>\r\n					<li class=\"abcom-list__item\">Yvonne Strahovsky</li>\r\n					<li class=\"abcom-list__item\">Natalie Dormer</li>\r\n				</ol>\r\n			</div>\r\n		</div>\r\n	</div>\r\n</div>\r\n<pre class=\"yondu__code\"><code>&lt;div class=&quot;form-group abcom-list&quot;&gt;\r\n  &lt;label for=&quot;&quot; class=&quot;col-sm-2 abcom-form&quot;&gt;Endorsers&lt;/label&gt;\r\n  &lt;div class=&quot;col-sm-10&quot;&gt;\r\n    &lt;ol class=&quot;abcom-list__items&quot;&gt;\r\n      &lt;li class=&quot;abcom-list__item&quot;&gt;Juan Dela Cruz&lt;/li&gt;\r\n      &lt;li class=&quot;abcom-list__item&quot;&gt;Johann Cheese&lt;/li&gt;\r\n      &lt;li class=&quot;abcom-list__item&quot;&gt;Yvonne Strahovsky&lt;/li&gt;\r\n      &lt;li class=&quot;abcom-list__item&quot;&gt;Natalie Dormer&lt;/li&gt;\r\n    &lt;/ol&gt;\r\n  &lt;/div&gt;\r\n&lt;/div&gt;</code></pre>\r\n\r\n<h4>Listing with forms</h4>\r\n<p>In Listing with forms, make sure that the <code>id</code> of the <code>select</code> element is the same as the <code>data-target</code> of the list <code>ol</code>.</p>\r\n<p>Example:</p>\r\n<pre class=\"yondu__code\"><code>&lt;select multiple <b>id=&quot;select2&quot;</b> data-title=&quot;Endorser&quot; class=&quot;form-control abcom-list__dropdown abcom-form&quot; &gt;</code></pre>\r\n<pre class=\"yondu__code\"><code>&lt;ol class=&quot;abcom-list&quot; <b>data-parent=&quot;select2&quot;</b>&gt;</code></pre>\r\n\r\n<div class=\"panel panel-default\">\r\n	<div class=\"panel-body\">\r\n		<div class=\"form-group abcom-list\">\r\n			<label for=\"\" class=\"col-sm-2 abcom-form\">Endorsers</label>\r\n			<div class=\"col-sm-10\">\r\n				<div class=\"input-group abcom-form__inputgroup\">\r\n					<select multiple id=\"select2\" data-title=\"Endorser\" class=\"form-control abcom-list__dropdown abcom-form\" >\r\n						<option value=\"1\">Juan Dela Cruz</option>\r\n						<option value=\"2\">Johann Cheese</option>\r\n						<option value=\"3\">Yvonne Strahovsky</option>\r\n						<option value=\"4\">Natalie Dormer</option>\r\n					</select>\r\n					<div class=\"input-group-addon\">\r\n						<button type=\"button\" class=\"btn abcom-btn abcom-btn--default abcom-list__add\"><span class=\"glyphicon glyphicon-plus\"></span></button>\r\n					</div>\r\n				</div>\r\n				<ol class=\"abcom-list__items\" data-parent=\"select2\"></ol>\r\n			</div>\r\n		</div>\r\n	</div>\r\n</div>\r\n\r\n<pre class=\"yondu__code\"><code>&lt;div class=&quot;form-group abcom-list&quot;&gt;\r\n	&lt;label for=&quot;&quot; class=&quot;col-sm-2 abcom-form&quot;&gt;Endorsers&lt;/label&gt;\r\n	&lt;div class=&quot;col-sm-10&quot;&gt;\r\n		&lt;div class=&quot;input-group abcom-form__inputgroup&quot;&gt;\r\n			&lt;select multiple id=&quot;select2&quot; data-title=&quot;Endorser&quot; class=&quot;form-control abcom-list__dropdown abcom-form&quot; &gt;\r\n				&lt;option value=&quot;1&quot;&gt;Juan Dela Cruz&lt;/option&gt;\r\n				&lt;option value=&quot;2&quot;&gt;Johann Cheese&lt;/option&gt;\r\n				&lt;option value=&quot;3&quot;&gt;Yvonne Strahovsky&lt;/option&gt;\r\n				&lt;option value=&quot;4&quot;&gt;Natalie Dormer&lt;/option&gt;\r\n			&lt;/select&gt;\r\n			&lt;div class=&quot;input-group-addon&quot;&gt;\r\n				&lt;button type=&quot;button&quot; class=&quot;btn abcom-btn abcom-btn--default abcom-list__add&quot;&gt;&lt;span class=&quot;glyphicon glyphicon-plus&quot;&gt;&lt;/span&gt;&lt;/button&gt;\r\n			&lt;/div&gt;\r\n		&lt;/div&gt;\r\n		&lt;ol class=&quot;abcom-list__items&quot; data-parent=&quot;select2&quot;&gt;&lt;/ol&gt;\r\n	&lt;/div&gt;\r\n&lt;/div&gt;</code></pre>\r\n\r\n<h4>Using Dates with Listing</h4>\r\n<p>You can use Listing with Dates.</p>\r\n\r\n<div class=\"panel panel-default\">\r\n	<div class=\"panel-body\">\r\n\r\n		<div class=\"form-group abcom-list--v3\">\r\n			<label for=\"\" class=\"col-sm-1\">Date</label>\r\n			<div class=\"col-sm-4\">\r\n				<input type=\"text\" data-name=\"date\" class=\"abcom-list__date form-control abcom-form abcom-form__date abcom-form--full\" placeholder=\"MM/DD/YYYY\" />\r\n			</div>\r\n			<label for=\"form_typemom\" class=\"col-sm-2\">Type of Meeting</label>\r\n			<div class=\"col-sm-5\">\r\n				<div class=\"input-group abcom-form__inputgroup\">\r\n					<select id=\"form_typemom\" data-name=\"type\" placeholder=\"Select Type\" class=\"form-control abcom-form\" >\r\n						<option value=\"none\" selected>Select Type</option>\r\n						<option value=\"1\">Juan Dela Cruz</option>\r\n						<option value=\"2\">Johann Cheese</option>\r\n						<option value=\"3\">Yvonne Strahovsky</option>\r\n						<option value=\"4\">Natalie Dormer</option>\r\n					</select>\r\n					<div class=\"input-group-addon\">\r\n						<button type=\"button\" class=\"btn abcom-btn abcom-btn--default abcom-list__add\"><span class=\"glyphicon glyphicon-plus\"></span></button>\r\n					</div>\r\n				</div>\r\n			</div>\r\n			<div class=\"col-sm-12\">\r\n				<ol class=\"abcom-list__items\" data-parent=\"abcom-list__select2date\"></ol>\r\n			</div>\r\n			<input type=\"hidden\" name=\"\" data-name=\"hidden\" class=\"abcom-list__input\">\r\n		</div>\r\n\r\n	</div>\r\n</div>\r\n\r\n<pre class=\"yondu__code\"><code>&lt;div class=&quot;form-group abcom-list--v3&quot;&gt;\r\n	&lt;label for=&quot;&quot; class=&quot;col-sm-1&quot;&gt;Date&lt;/label&gt;\r\n	&lt;div class=&quot;col-sm-4&quot;&gt;\r\n		&lt;input type=&quot;text&quot; data-name=&quot;date&quot; class=&quot;abcom-list__date form-control abcom-form abcom-form__date abcom-form--full&quot; placeholder=&quot;MM/DD/YYYY&quot; /&gt;\r\n	&lt;/div&gt;\r\n	&lt;label for=&quot;form_typemom&quot; class=&quot;col-sm-2&quot;&gt;Type of Meeting&lt;/label&gt;\r\n	&lt;div class=&quot;col-sm-5&quot;&gt;\r\n		&lt;div class=&quot;input-group abcom-form__inputgroup&quot;&gt;\r\n			&lt;select id=&quot;form_typemom&quot; data-name=&quot;type&quot; placeholder=&quot;Select Type&quot; class=&quot;form-control abcom-form&quot; &gt;\r\n				&lt;option value=&quot;none&quot; selected&gt;Select Type&lt;/option&gt;\r\n				&lt;option value=&quot;1&quot;&gt;Juan Dela Cruz&lt;/option&gt;\r\n				&lt;option value=&quot;2&quot;&gt;Johann Cheese&lt;/option&gt;\r\n				&lt;option value=&quot;3&quot;&gt;Yvonne Strahovsky&lt;/option&gt;\r\n				&lt;option value=&quot;4&quot;&gt;Natalie Dormer&lt;/option&gt;\r\n			&lt;/select&gt;\r\n			&lt;div class=&quot;input-group-addon&quot;&gt;\r\n				&lt;button type=&quot;button&quot; class=&quot;btn abcom-btn abcom-btn--default abcom-list__add&quot;&gt;&lt;span class=&quot;glyphicon glyphicon-plus&quot;&gt;&lt;/span&gt;&lt;/button&gt;\r\n			&lt;/div&gt;\r\n		&lt;/div&gt;\r\n	&lt;/div&gt;\r\n	&lt;div class=&quot;col-sm-12&quot;&gt;\r\n		&lt;ol class=&quot;abcom-list__items&quot; data-parent=&quot;abcom-list__select2date&quot;&gt;&lt;/ol&gt;\r\n	&lt;/div&gt;\r\n	&lt;input type=&quot;hidden&quot; name=&quot;&quot; data-name=&quot;hidden&quot; class=&quot;abcom-list__input&quot;&gt;\r\n&lt;/div&gt;</code></pre>\r\n\r\n\r\n\r\n<h4>Using in Directors / Officers with Designation</h4>\r\n<p>Here is another version you can use.</p>\r\n\r\n<div class=\"panel panel-default\">\r\n	<div class=\"panel-body\">\r\n		<div class=\"form-group abcom-list--v2\">\r\n			<label for=\"\" class=\"col-sm-2 abcom-form\">Directors</label>\r\n			<div class=\"col-sm-4\">\r\n				<input type=\"text\" data-name=\"name\" class=\"form-control abcom-form\" placeholder=\"Type name here\">\r\n			</div>\r\n			<div class=\"col-sm-5\">\r\n				<div class=\"input-group abcom-form__inputgroup\">\r\n					<input type=\"text\" data-name=\"designation\" class=\"form-control abcom-form\" placeholder=\"Type Designation here\">\r\n					<div class=\"input-group-addon\">\r\n						<button type=\"button\" class=\"btn abcom-btn abcom-btn--default abcom-list__add\"><span class=\"glyphicon glyphicon-plus\"></span></button>\r\n					</div>\r\n				</div>\r\n			</div>\r\n			<div class=\"col-sm-offset-2 col-sm-10\">\r\n				<ol class=\"abcom-list__items\" data-parent=\"select2\"></ol>\r\n			</div>\r\n			<input type=\"hidden\" name=\"\" data-name=\"hidden\" class=\"abcom-list__input\">\r\n		</div>\r\n	</div>\r\n</div>\r\n\r\n<p>Here is the markup for the customized listing.</p>\r\n<pre class=\"yondu__code\"><code>&lt;div class=&quot;form-group abcom-list--v2&quot;&gt;\r\n	&lt;label for=&quot;&quot; class=&quot;col-sm-2 abcom-form&quot;&gt;Directors&lt;/label&gt;\r\n	&lt;div class=&quot;col-sm-4&quot;&gt;\r\n		&lt;input type=&quot;text&quot; data-name=&quot;name&quot; class=&quot;form-control abcom-form&quot; placeholder=&quot;Type name here&quot;&gt;\r\n	&lt;/div&gt;\r\n	&lt;div class=&quot;col-sm-5&quot;&gt;\r\n		&lt;div class=&quot;input-group abcom-form__inputgroup&quot;&gt;\r\n			&lt;input type=&quot;text&quot; data-name=&quot;designation&quot; class=&quot;form-control abcom-form&quot; placeholder=&quot;Type Designation here&quot;&gt;\r\n			&lt;div class=&quot;input-group-addon&quot;&gt;\r\n				&lt;button type=&quot;button&quot; class=&quot;btn abcom-btn abcom-btn--default abcom-list__add&quot;&gt;&lt;span class=&quot;glyphicon glyphicon-plus&quot;&gt;&lt;/span&gt;&lt;/button&gt;\r\n			&lt;/div&gt;\r\n		&lt;/div&gt;\r\n	&lt;/div&gt;\r\n	&lt;div class=&quot;col-sm-offset-2 col-sm-10&quot;&gt;\r\n		&lt;ol class=&quot;abcom-list__items&quot; data-parent=&quot;select2&quot;&gt;&lt;/ol&gt;\r\n	&lt;/div&gt;\r\n	&lt;input type=&quot;hidden&quot; name=&quot;&quot; data-name=&quot;hidden&quot; class=&quot;abcom-list__input&quot;&gt;\r\n&lt;/div&gt;</code></pre>\r\n\r\n\r\n\r\n<h4>Listing in MoM Template Creation</h4>\r\n<p>Here is another version you can use.</p>\r\n\r\n<div class=\"panel panel-default\">\r\n	<div class=\"panel-body\">\r\n		\r\n		<form action=\"\" class=\"form-horizontal abcom-list--mom\">\r\n          <div class=\"form-group\">\r\n            <label for=\"modal_form_company\" class=\"col-sm-4 abcom-container--left\">Document Name</label>\r\n            <div class=\"col-sm-8\">\r\n              <input type=\"text\" name=\"\" id=\"modal_form_company\" class=\"abcom-form abcom-form--full abcom-form--hasmargin form-control\" placeholder=\"Type here\">\r\n            </div>\r\n          </div>\r\n\r\n          <div class=\"form-group\">\r\n          	<table>\r\n          		<thead>\r\n          			<tr>\r\n	          			<th>Associated Service Type</th>\r\n	          			<th>Category</th>\r\n	          			<th>Sub Category A</th>\r\n	          			<th>Sub Category B</th>\r\n	          			<th>Action</th>\r\n	          		</tr>\r\n          		</thead>\r\n          		<tbody class=\"abcom-list__items\">\r\n          			<tr class=\"abcom-list__item--fix\">\r\n          				<td>\r\n          					<select name=\"\" id=\"modal_form_service\" data-name=\"stype\" data-required=\"true\" class=\"selectpicker abcom-form abcom-form--full form-control\">\r\n				                <option value=\"none\" selected>Select Service Type</option>\r\n				                <option value=\"1\">Type A</option>\r\n				                <option value=\"2\">Type B</option>\r\n				            </select>\r\n				          </td>\r\n				          <td>\r\n				          	<select name=\"\" id=\"modal_form_service\" data-name=\"cat\" class=\"selectpicker abcom-form abcom-form--full form-control\">\r\n				                <option value=\"none\" selected>Select Category</option>\r\n				                <option value=\"3\">Category A</option>\r\n				                <option value=\"4\">Category B</option>\r\n				            </select>\r\n				          </td>\r\n				          <td>\r\n				          	<select name=\"\" id=\"modal_form_service\" data-name=\"scata\" class=\"selectpicker abcom-form abcom-form--full form-control\">\r\n				                <option value=\"none\" selected>Select Sub Category A</option>\r\n				                <option value=\"5\">Sub-Category A - 1</option>\r\n				                <option value=\"6\">Sub-Category A - 2</option>\r\n				            </select>\r\n				          </td>\r\n				          <td>\r\n				          	<select name=\"\" id=\"modal_form_service\" data-name=\"scatb\" class=\"selectpicker abcom-form abcom-form--full form-control\">\r\n				                <option value=\"none\" selected>Select Sub Category B</option>\r\n				                <option value=\"7\">Sub-Category B - 1</option>\r\n				                <option value=\"8\">Sub-Category B - 2</option>\r\n				            </select>\r\n				          </td>\r\n				          <td>\r\n				          	<button type=\"button\" class=\"btn abcom-btn abcom-btn--default abcom-list__add\"><span class=\"glyphicon glyphicon-plus\"></span></button>\r\n				          </td>\r\n          			</tr>\r\n          		</tbody>\r\n          	</table>\r\n          </div>\r\n\r\n          <div class=\"form-group\">\r\n            <div class=\"col-sm-12\">\r\n              <input type=\"submit\" class=\"btn abcom-btn abcom-btn--action abcom-form--full\" value=\"Submit\">\r\n            </div>\r\n          </div>\r\n          <input type=\"hidden\" name=\"\" data-name=\"hidden\" class=\"abcom-list__input\">\r\n        </form>\r\n\r\n	</div>\r\n</div>\r\n\r\n<pre class=\"yondu__code\"><code>&lt;form action=&quot;&quot; class=&quot;form-horizontal abcom-list--mom&quot;&gt;\r\n  &lt;div class=&quot;form-group&quot;&gt;\r\n    &lt;label for=&quot;modal_form_company&quot; class=&quot;col-sm-4 abcom-container--left&quot;&gt;Document Name&lt;/label&gt;\r\n    &lt;div class=&quot;col-sm-8&quot;&gt;\r\n      &lt;input type=&quot;text&quot; name=&quot;&quot; id=&quot;modal_form_company&quot; class=&quot;abcom-form abcom-form--full abcom-form--hasmargin form-control&quot; placeholder=&quot;Type here&quot;&gt;\r\n    &lt;/div&gt;\r\n  &lt;/div&gt;\r\n\r\n  &lt;div class=&quot;form-group&quot;&gt;\r\n  	&lt;table&gt;\r\n  		&lt;thead&gt;\r\n  			&lt;tr&gt;\r\n      			&lt;th&gt;Associated Service Type&lt;/th&gt;\r\n      			&lt;th&gt;Category&lt;/th&gt;\r\n      			&lt;th&gt;Sub Category A&lt;/th&gt;\r\n      			&lt;th&gt;Sub Category B&lt;/th&gt;\r\n      			&lt;th&gt;Action&lt;/th&gt;\r\n      		&lt;/tr&gt;\r\n  		&lt;/thead&gt;\r\n  		&lt;tbody class=&quot;abcom-list__items&quot;&gt;\r\n  			&lt;tr class=&quot;abcom-list__item--fix&quot;&gt;\r\n  				&lt;td&gt;\r\n  					&lt;select name=&quot;&quot; id=&quot;modal_form_service&quot; data-name=&quot;stype&quot; data-required=&quot;true&quot; class=&quot;selectpicker abcom-form abcom-form--full form-control&quot;&gt;\r\n		                &lt;option value=&quot;none&quot; selected&gt;Select Service Type&lt;/option&gt;\r\n		                &lt;option value=&quot;1&quot;&gt;Type A&lt;/option&gt;\r\n		                &lt;option value=&quot;2&quot;&gt;Type B&lt;/option&gt;\r\n		            &lt;/select&gt;\r\n		          &lt;/td&gt;\r\n		          &lt;td&gt;\r\n		          	&lt;select name=&quot;&quot; id=&quot;modal_form_service&quot; data-name=&quot;cat&quot; class=&quot;selectpicker abcom-form abcom-form--full form-control&quot;&gt;\r\n		                &lt;option value=&quot;none&quot; selected&gt;Select Category&lt;/option&gt;\r\n		                &lt;option value=&quot;3&quot;&gt;Category A&lt;/option&gt;\r\n		                &lt;option value=&quot;4&quot;&gt;Category B&lt;/option&gt;\r\n		            &lt;/select&gt;\r\n		          &lt;/td&gt;\r\n		          &lt;td&gt;\r\n		          	&lt;select name=&quot;&quot; id=&quot;modal_form_service&quot; data-name=&quot;scata&quot; class=&quot;selectpicker abcom-form abcom-form--full form-control&quot;&gt;\r\n		                &lt;option value=&quot;none&quot; selected&gt;Select Sub Category A&lt;/option&gt;\r\n		                &lt;option value=&quot;5&quot;&gt;Sub-Category A - 1&lt;/option&gt;\r\n		                &lt;option value=&quot;6&quot;&gt;Sub-Category A - 2&lt;/option&gt;\r\n		            &lt;/select&gt;\r\n		          &lt;/td&gt;\r\n		          &lt;td&gt;\r\n		          	&lt;select name=&quot;&quot; id=&quot;modal_form_service&quot; data-name=&quot;scatb&quot; class=&quot;selectpicker abcom-form abcom-form--full form-control&quot;&gt;\r\n		                &lt;option value=&quot;none&quot; selected&gt;Select Sub Category B&lt;/option&gt;\r\n		                &lt;option value=&quot;7&quot;&gt;Sub-Category B - 1&lt;/option&gt;\r\n		                &lt;option value=&quot;8&quot;&gt;Sub-Category B - 2&lt;/option&gt;\r\n		            &lt;/select&gt;\r\n		          &lt;/td&gt;\r\n		          &lt;td&gt;\r\n		          	&lt;button type=&quot;button&quot; class=&quot;btn abcom-btn abcom-btn--default abcom-list__add&quot;&gt;&lt;span class=&quot;glyphicon glyphicon-plus&quot;&gt;&lt;/span&gt;&lt;/button&gt;\r\n		          &lt;/td&gt;\r\n  			&lt;/tr&gt;\r\n  		&lt;/tbody&gt;\r\n  	&lt;/table&gt;\r\n  &lt;/div&gt;\r\n\r\n  &lt;div class=&quot;form-group&quot;&gt;\r\n    &lt;div class=&quot;col-sm-12&quot;&gt;\r\n      &lt;input type=&quot;submit&quot; class=&quot;btn abcom-btn abcom-btn--action abcom-form--full&quot; value=&quot;Submit&quot;&gt;\r\n    &lt;/div&gt;\r\n  &lt;/div&gt;\r\n  &lt;input type=&quot;hidden&quot; name=&quot;&quot; data-name=&quot;hidden&quot; class=&quot;abcom-list__input&quot;&gt;\r\n&lt;/form&gt;</code></pre>";
},"useData":true});

this["App"]["Templates"]["reusables/abcom-modal"] = Handlebars.template({"compiler":[7,">= 4.0.0"],"main":function(container,depth0,helpers,partials,data) {
    return "<h2>Modal</h2>\r\n<p>Displays a separate container above the document, with a faded black background.</p>\r\n<div class=\"panel panel-default\">\r\n	<div class=\"panel-body\">\r\n		<div class=\"modal fade abcom-modal\" tabindex=\"-1\" role=\"dialog\">\r\n		  <div class=\"modal-dialog\">\r\n		    <div class=\"modal-content\">\r\n			  	<div class=\"modal-header\">\r\n			        <button type=\"button\" class=\"close\" data-dismiss=\"modal\" aria-label=\"Close\"><span aria-hidden=\"true\">&times;</span></button>\r\n			    	<h4 class=\"modal-title\" id=\"myModalLabel\">Modal title</h4>\r\n			    </div>\r\n			    <div class=\"modal-body\">...</div>\r\n		    </div>\r\n		  </div>\r\n		</div>\r\n		\r\n<p>Declaring the toggle button for the modal. It is important to use the <code>data-toggle</code> and <code>data-target</code> on a button to utilize bootstrap modal component.</p>\r\n<pre class=\"yondu__code\"><code>&lt;button data-toggle=&quot;modal&quot; data-target=&quot;.abcom-modal&quot; class=&quot;btn abcom-btn abcom-btn--default&quot;&gt;Launch Demo&lt;/button&gt;</code></pre>\r\n\r\n<p>Here is a sample code for the modal. Take note of the <code>class</code> that is in turn being targeted by the button.</p>\r\n<pre class=\"yondu__code\"><code>&lt;div class=&quot;modal fade abcom-modal&quot; tabindex=&quot;-1&quot; role=&quot;dialog&quot;&gt;\r\n  &lt;div class=&quot;modal-dialog&quot;&gt;\r\n    &lt;div class=&quot;modal-content&quot;&gt;\r\n        &lt;div class=&quot;modal-header&quot;&gt;\r\n            &lt;button type=&quot;button&quot; class=&quot;close&quot; data-dismiss=&quot;modal&quot; aria-label=&quot;Close&quot;&gt;&lt;span aria-hidden=&quot;true&quot;&gt;&times;&lt;/span&gt;&lt;/button&gt;\r\n            &lt;h4 class=&quot;modal-title&quot; id=&quot;myModalLabel&quot;&gt;Modal title&lt;/h4&gt;\r\n        &lt;/div&gt;\r\n        &lt;div class=&quot;modal-body&quot;&gt;...&lt;/div&gt;\r\n    &lt;/div&gt;\r\n  &lt;/div&gt;\r\n&lt;/div&gt;</code></pre>\r\n\r\n<button type=\"button\" data-toggle=\"modal\" data-target=\".abcom-modal\" class=\"btn abcom-btn abcom-btn--default\">Launch Demo</button>\r\n<p></p>\r\n<p>You can also use the modal size from bootstrap by adding a <code>modal-sm</code> or <code>modal-lg</code> in the <code>modal-dialog</code> class.</p>\r\n<pre class=\"yondu__code\"><code>&lt;div class=&quot;modal-dialog modal-sm&quot;&gt;</code></pre>\r\n<pre class=\"yondu__code\"><code>&lt;div class=&quot;modal-dialog modal-lg&quot;&gt;</code></pre>\r\n	</div>\r\n</div>\r\n\r\n<h3>Using Remote Content</h3>\r\n<p>The trigger button for the modal must have a <code>data-src</code> attribute pointing to the url of the iframe. Example: <code>data-src=&quot;http://localhost/AboitizLegal2/app/&quot;</code>. Also, we have to remove the <code>data-toggle=&quot;modal&quot;</code> from the button to make it work.</p>\r\n\r\n<div class=\"panel panel-default\">\r\n	<div class=\"panel-body\">\r\n		<div id=\"modalIframe\" class=\"modal fade abcom-modal\" tabindex=\"-1\" role=\"dialog\">\r\n		  <div class=\"modal-dialog\">\r\n		    <div class=\"modal-content\">\r\n			  	<div class=\"modal-header\">\r\n			        <button type=\"button\" class=\"close\" data-dismiss=\"modal\" aria-label=\"Close\"><span aria-hidden=\"true\">&times;</span></button>\r\n			    	<h4 class=\"modal-title\" id=\"myModalLabel\">Modal title</h4>\r\n			    </div>\r\n			    <div class=\"modal-body\"><iframe src=\"\" frameborder=\"0\"></iframe></div>\r\n		    </div>\r\n		  </div>\r\n		</div>\r\n		\r\n		<button type=\"button\" data-src=\"http://localhost/AboitizLegal2/app/\" data-target=\"#modalIframe\" class=\"btn abcom-btn abcom-btn--default\">Launch Demo</button>\r\n\r\n	</div>\r\n</div>\r\n\r\n<pre class=\"yondu__code\"><code>&lt;button type=&quot;button&quot; data-src=&quot;http://localhost/AboitizLegal2/app/&quot; data-target=&quot;#modalIframe&quot; class=&quot;btn abcom-btn abcom-btn--default&quot;&gt;Launch Demo&lt;/button&gt;</code></pre>";
},"useData":true});

this["App"]["Templates"]["reusables/abcom-progress"] = Handlebars.template({"compiler":[7,">= 4.0.0"],"main":function(container,depth0,helpers,partials,data) {
    return "<h2>Progress Bar</h2>\r\n<p>This is used for Status (Progress bar) which utilizes the hint.css plugin</p>\r\n<div class=\"panel panel-default\">\r\n	<div class=\"panel-body\">\r\n		<div class=\"abcom-progress hint--left\" data-color=\"default\" data-hint=\"For Endorsement\" data-value=\"60\" data-max=\"100\">\r\n			<div class=\"abcom-progress__value\"></div>\r\n		</div>\r\n	</div>\r\n</div>\r\n\r\n<p>This are used especially inside a table data whenever a request page is concerned.</p>\r\n<p>Make sure that the <code>div</code> <code>abcom-progress</code> has the <code>hint--left</code> class. Also make use of <code>data-hint=\"...\"</code> attribute to tell what to display in the tooltip.</p>\r\n<p>The <code>data-value</code> plays a huge part for the graphical representation of the progress. <code>data-max</code> is used as the maximum or the 100% value of the progress. Also, include a <code>data-color</code> attribute for the color of the value. If none is set, the default color from the css will be used.</p>\r\n<pre class=\"yondu__code\"><code>&lt;div class=&quot;abcom-progress hint--left&quot; data-color=&quot;default&quot; data-hint=&quot;For Endorsement&quot; data-value=&quot;60&quot; data-max=&quot;100&quot;&gt;\r\n  &lt;div class=&quot;abcom-progress__value&quot;&gt;&lt;/div&gt;\r\n&lt;/div&gt;</code></pre>\r\n\r\n<h3>Sample with Data Tables</h3>\r\n<p>Here is a sample code for integrating progress status bar inside a table</p>\r\n<div class=\"panel panel-default\">\r\n	<div class=\"panel-body\">\r\n	\r\n		<table id=\"table_id\" class=\"abcom abcom-table\">\r\n	        <thead>\r\n	            <tr>\r\n	                <th>Column 1</th>\r\n	                <th>Column 2</th>\r\n	                <th>Column 2</th>\r\n	                <th>Column 2</th>\r\n	                <th>Column 2</th>\r\n	            </tr>\r\n	        </thead>\r\n	        <tbody>\r\n	            <tr>\r\n	                <td>Row 1 Data 1</td>\r\n	                <td><div class=\"abcom-progress hint--left\" data-color=\"default\" data-hint=\"For Endorsement\" data-value=\"60\" data-max=\"100\">\r\n						<div class=\"abcom-progress__value\"></div>\r\n					</div></td>\r\n	                <td>Row 1 Data 2</td>\r\n	                <td>Row 1 Data 2</td>\r\n	                <td>Row 1 Data 2</td>\r\n	            </tr>\r\n	            <tr>\r\n	                <td>Row 2 Data 1</td>\r\n	                <td><div class=\"abcom-progress hint--left\" data-color=\"default\" data-hint=\"For Approval\" data-value=\"30\" data-max=\"100\">\r\n						<div class=\"abcom-progress__value\"></div>\r\n					</div></td>\r\n	                <td>Row 2 Data 2</td>\r\n	                <td>Row 2 Data 2</td>\r\n	                <td>Row 2 Data 2</td>\r\n	            </tr>\r\n	        </tbody>\r\n	    </table><!-- // End abcom-table -->\r\n	</div>\r\n</div>\r\n\r\n<h3>Using color picker</h3>\r\n<div class=\"panel panel-default\">\r\n	<div class=\"panel-body\">\r\n		<div class=\"abcom-progress abcom-color hint--left\" data-color=\"default\" data-hint=\"For Endorsement\" data-value=\"60\" data-max=\"100\">\r\n			<div class=\"abcom-progress__value\"></div>\r\n		</div>\r\n	</div>\r\n</div>\r\n\r\n<p>Here is the code for the Progress bar with Color Picker. The element should have a <code>abcom-color</code> class and has the <code>data-color</code> attribute.</p>\r\n<pre class=\"yondu__code\"><code>&lt;div class=&quot;abcom-progress abcom-color hint--left&quot; data-color=&quot;default&quot; data-hint=&quot;For Endorsement&quot; data-value=&quot;60&quot; data-max=&quot;100&quot;&gt;\r\n  &lt;div class=&quot;abcom-progress__value&quot;&gt;&lt;/div&gt;\r\n&lt;/div&gt;</code></pre>";
},"useData":true});

this["App"]["Templates"]["reusables/abcom-table"] = Handlebars.template({"compiler":[7,">= 4.0.0"],"main":function(container,depth0,helpers,partials,data) {
    return "<h2>Tables</h2>\r\n<hr>\r\n<h3>Table Tag</h3>\r\n<p>Tables in Aboitiz Legal utilizes the <code>Data Tables</code> plugin.</p>\r\n<p>Here is the basic view of Data Tables. The table must have an ID and is used on initialization.</p>\r\n<div class=\"panel panel-default\">\r\n  <div class=\"panel-body\">\r\n    <table id=\"table_id\" class=\"abcom abcom-table\">\r\n        <thead>\r\n            <tr>\r\n                <th>Column 1</th>\r\n                <th>Column 2</th>\r\n                <th>Column 2</th>\r\n                <th>Column 2</th>\r\n                <th>Column 2</th>\r\n            </tr>\r\n        </thead>\r\n        <tbody>\r\n            <tr>\r\n                <td>Row 1 Data 1</td>\r\n                <td>Row 1 Data 2</td>\r\n                <td>Row 1 Data 2</td>\r\n                <td>Row 1 Data 2</td>\r\n                <td>Row 1 Data 2</td>\r\n            </tr>\r\n            <tr>\r\n                <td>Row 2 Data 1</td>\r\n                <td>Row 2 Data 2</td>\r\n                <td>Row 2 Data 2</td>\r\n                <td>Row 2 Data 2</td>\r\n                <td>Row 2 Data 2</td>\r\n            </tr>\r\n        </tbody>\r\n      </table><!-- // End abcom-table -->\r\n  </div>\r\n</div>\r\n<pre class=\"yondu__code\"><code>&lt;table id=&quot;table_id&quot; class=&quot;abcom abcom-table&quot;&gt;\r\n    &lt;thead&gt;\r\n        &lt;tr&gt;\r\n            &lt;th&gt;Column 1&lt;/th&gt;\r\n            &lt;th&gt;Column 2&lt;/th&gt;\r\n            &lt;th&gt;Column 2&lt;/th&gt;\r\n            &lt;th&gt;Column 2&lt;/th&gt;\r\n            &lt;th&gt;Column 2&lt;/th&gt;\r\n        &lt;/tr&gt;\r\n    &lt;/thead&gt;\r\n    &lt;tbody&gt;\r\n        &lt;tr&gt;\r\n            &lt;td&gt;Row 1 Data 1&lt;/td&gt;\r\n            &lt;td&gt;Row 1 Data 2&lt;/td&gt;\r\n            &lt;td&gt;Row 1 Data 2&lt;/td&gt;\r\n            &lt;td&gt;Row 1 Data 2&lt;/td&gt;\r\n            &lt;td&gt;Row 1 Data 2&lt;/td&gt;\r\n        &lt;/tr&gt;\r\n        &lt;tr&gt;\r\n            &lt;td&gt;Row 2 Data 1&lt;/td&gt;\r\n            &lt;td&gt;Row 2 Data 2&lt;/td&gt;\r\n            &lt;td&gt;Row 2 Data 2&lt;/td&gt;\r\n            &lt;td&gt;Row 2 Data 2&lt;/td&gt;\r\n            &lt;td&gt;Row 2 Data 2&lt;/td&gt;\r\n        &lt;/tr&gt;\r\n    &lt;/tbody&gt;\r\n&lt;/table&gt;</code></pre>\r\n\r\n<hr>\r\n<h3>Initialize using Javascript</h3>\r\n<p>Include a <code>&lt;script&gt;</code> tag at the bottom of your HTML document -- before the <code>&lt;/body&gt;</code> tag -- and use the following code.</p>\r\n<pre class=\"yondu__code\"><code>$('.abcom-table').DataTable();</code></pre>\r\n\r\n<hr>\r\n<h3>Removing other elements</h3>\r\n<div class=\"panel panel-default\">\r\n  <div class=\"panel-body\">\r\n    <table id=\"table_id2\" class=\"abcom abcom-table\">\r\n        <thead>\r\n            <tr>\r\n                <th>Column 1</th>\r\n                <th>Column 2</th>\r\n                <th>Column 2</th>\r\n                <th>Column 2</th>\r\n                <th>Column 2</th>\r\n            </tr>\r\n        </thead>\r\n        <tbody>\r\n            <tr>\r\n                <td>Row 1 Data 1</td>\r\n                <td>Row 1 Data 2</td>\r\n                <td>Row 1 Data 2</td>\r\n                <td>Row 1 Data 2</td>\r\n                <td>Row 1 Data 2</td>\r\n            </tr>\r\n            <tr>\r\n                <td>Row 2 Data 1</td>\r\n                <td>Row 2 Data 2</td>\r\n                <td>Row 2 Data 2</td>\r\n                <td>Row 2 Data 2</td>\r\n                <td>Row 2 Data 2</td>\r\n            </tr>\r\n        </tbody>\r\n      </table><!-- // End abcom-table -->\r\n  </div>\r\n</div>\r\n<p>Include a <code>&lt;script&gt;</code> tag at the bottom of your HTML document -- before the <code>&lt;/body&gt;</code> tag -- and use the following code.</p>\r\n<pre class=\"yondu__code\"><code>$('.abcom-table').DataTable({\r\n  searching : false,\r\n  paging : false,\r\n  info : false\r\n});</code></pre>\r\n<p>Here, we used data table options like <code>searching</code>, <code>paging</code> and <code>info</code> for the layout. You can always refer to datatables plugin documentation <a href=\"https://www.datatables.net/\" target=\"_blank\" >here</a>.</p>\r\n\r\n<hr>\r\n<h3>Aboitiz Status</h3>\r\n<div class=\"panel panel-default\">\r\n  <div class=\"panel-body\">\r\n    <table id=\"table_id2\" class=\"abcom abcom-table\">\r\n        <thead>\r\n            <tr>\r\n                <th>Column 1</th>\r\n                <th>Column 2</th>\r\n                <th>Column 2</th>\r\n                <th>Column 2</th>\r\n                <th>Column 2</th>\r\n            </tr>\r\n        </thead>\r\n        <tbody>\r\n            <tr>\r\n                <td>Row 1 Data 1</td>\r\n                <td class=\"is-status\">Row 1 Data 2</td>\r\n                <td>Row 1 Data 2</td>\r\n                <td>Row 1 Data 2</td>\r\n                <td>Row 1 Data 2</td>\r\n            </tr>\r\n            <tr>\r\n                <td>Row 2 Data 1</td>\r\n                <td class=\"is-status\">Row 2 Data 2</td>\r\n                <td>Row 2 Data 2</td>\r\n                <td>Row 2 Data 2</td>\r\n                <td>Row 2 Data 2</td>\r\n            </tr>\r\n        </tbody>\r\n    </table><!-- // End abcom-table -->\r\n  </div>\r\n</div>";
},"useData":true});

